const Header = () => {
  return (
      <AppBar position="static">
        <Toolbar>
        <Typography variant="h6">
            Cookenu
        </Typography>
        <Button color="inherit">Login</Button>
        </Toolbar>
      </AppBar>
  );
}

export default Header
